import * as React from "react";
import { styled } from '@mui/material/styles';
import Box from "@mui/material/Box";
import CssBaseline from "@mui/material/CssBaseline";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";
import Link from "@mui/material/Link";
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';
import MailOutlineRoundedIcon from '@mui/icons-material/MailOutlineRounded';
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import TwitterIcon from "@mui/icons-material/Twitter";


function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary">
      {"Copyright © "}
      <Link color="inherit" href="/">
        SupportED
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}
const Item = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(1),
}));

const CopyRight = styled(Typography)(({ theme }) => ({
  textAlign: 'center',
  color: theme.palette.text.primary,
  margin: theme.spacing(6, 'auto'),
}));

const Address = styled(Typography)(({ theme }) => ({
  padding: theme.spacing(1),
  textAlign: 'left',
  color: theme.palette.text.primary,
}));

export default function FixedBottomNavigation() {
  return (
    <Box sx={{ pb: 7 }}>
      <CssBaseline />
      <Paper
        sx={{ position: "fixed", bottom: 0, left: 0, right: 0 }}
        elevation={3}
      >
      <Item>
        <Grid container>
        <Grid xs={6} md={4}>
          <Address>
            <Typography paddingBottom={1}>SupportED</Typography>
            <Typography>Contact Us</Typography>
            <Typography>Phone: 071 0000111/ 011 2000 111</Typography>
            <Typography>Email: supported@gmail.com</Typography>
          </Address>
        </Grid>
        <Grid xs={6} md={4}>
          <CopyRight>
            <Copyright />
          </CopyRight>
        </Grid>
        <Grid xs={6} md={4}>
          <Typography>Follow us on</Typography>
          <Address>
            <Stack
              direction={{ xs: 'column', sm: 'row' }}
              spacing={{ xs: 1, sm: 2, md: 4 }}
            >
              <FacebookRoundedIcon sx={{ display: { xs: '', md: 'flex',}, mr: 2 }} />
              <MailOutlineRoundedIcon sx={{ display: { xs: '', md: 'flex',}, mr: 2 }} />
              <LinkedInIcon sx={{ display: { xs: '', md: 'flex',}, mr: 2 }} />   
              <TwitterIcon sx={{ display: { xs: '', md: 'flex',}, mr: 2 }} />
            </Stack>
            </Address>
        </Grid>
      </Grid>
      </Item>
      </Paper>
    </Box>
  );
}
